import About from "./about";
import Link from "next/link";
import Header from "../common/header";

import Homepage from "../common/homepage";
const App = () => {
  return (
    <h1>
      <Header />
      <Link href="/Homepage">
        <a>Home</a>
      </Link>
      <Homepage />
    </h1>
  );
};
export default App;
